import './App.css';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router , Route} from "react-router-dom";
import Checkout from './Checkout';

function App() {
  return (
    <Router>
    <div className="App">


   <Route path="/checkout">
      <Header/>
      <Checkout/>
      </Route>
      <Route path="/">
      <Header/>
      <Home/>
      </Route>

    </div>
    </Router>
  );
}

export default App;
